DROP TABLE IF EXISTS `teacher_info`;
CREATE TABLE `teacher_info`  (
  `TEACHER_ID` varchar(8) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL COMMENT '教师ID',
